gQW(){return"In our projects we mainly use Java as the programming language and use Java programming libraries and standards. So we offer development of\nApplications based on Java Swing and Eclipse RCP\n- Client and server components for web services\n-Web applications based on the Google Web Toolkit (GWT)\n\nPartMaster consistently uses agile methods in application development, so you as a customer can continuously accompany and help shape the development process. You will receive the first software versions at an early stage, which you can check against your requirements and control the further development process. It is guaranteed that you will receive exactly the software on the completion date that best covers your requirements and optimally fulfills your expectations."},
