gDs(){return"We develop <em>IT strategies</em>, work out <em>criteria</em> for the use and selection of technologies and products, create <em>software components</em> and integrate them into existing <em>IT architectures</em>. As a small, technology-oriented company, we take on the role of <em>designer, mediator and bridge builder</em> for our customers in order to make use of opportunities for our customers that are offered by new technologies.\n\nOur goal is to complete the processes of the To optimally accompany customers with <em>intuitively operable software</em> and not restrict the <em>creativity</em>, <em>individuality</em> and the possibilities of <em>self-organization</em> of the employees, but to expand them. The work carried out results <em>quickly</em> in <em>concrete results</em>, which guarantees <em>planning security</em> and <em>investment security</em> for the customer.\n\nPartmaster GmbH is supported and financed by <em>MORE Invest</em>, a company of the <em>Innoveas Group</em>."},
gPB(){return"The journey by car is of course possible from different directions. In the immediate vicinity of our offices there is a city car park on Langen Stra\xdfe, where you can conveniently park your car. Coming out of the multi-storey car park, please turn right, walk straight ahead for a few meters and turn left into Lagerstrasse. The entrance to our offices is right here in the courtyard area."},
gPD(){return"From Rostock central station you can take the tram directly to the city center. Here you use the trains in the direction of the city. Get off at the 'Neuer Markt' stop and follow the tram tracks past the Marienkirche. At the next traffic light, cross the tram tracks ('Lange Stra\xdfer'). Then follow the course of Langen Stra\xdfe for a few meters until you see a large archway entrance on the right. Go through this entrance, down the stairs and turn right. Go straight ahead for about 10 meters and then turn left again. You can reach our offices via this inner courtyard."},
